#funciones extras para diversos temas, que no estan directamente relacionados con los views

def buscar_recurso_por_id(material_id):
  global recursosList
  """
  Función que busca un diccionario de recurso por su ID en una lista de recursos.

  Parámetros:
    material_id: El ID del recurso que se busca.
    recursosList: La lista de diccionarios de recursos.

  Retorno:
    El diccionario del recurso encontrado, o None si no se encuentra.
  """
  recursoData = None
  for recursoDic in recursosList:
    if recursoDic.get('id') == material_id:
      recursoData = recursoDic
      break
  return recursoData

def calcular_produccion_diaria_total(recurso, bonus_produccion, nivel=1):
    """
    Calcula la producción diaria total de un recurso, incluyendo el efecto de los niveles.

    Args:
        recurso: Diccionario de información del recurso.
        bonus_produccion: El porcentaje de bonus de producción.
        nivel: Nivel del edificio de producción.

    Returns:
        La producción total por día del recurso.
    """

    produccion_hora = recurso.get('producedAnHour', 0)
    produccion_base = produccion_hora * nivel
    produccion_dia = produccion_base * 24
    produccion_bonus = produccion_dia * (bonus_produccion / 100)
    produccion_diaria_total = produccion_dia + produccion_bonus

    return produccion_diaria_total


def calcular_materiales_necesarios(kind,limite,bonus):
    material = buscar_recurso_por_id(kind)
    for i in range(1,1000):
        produccion=calcular_produccion_diaria_total(material,bonus,i)
        if produccion>=limite:
            niveles_necesarios=i
            break

    return niveles_necesarios,round(produccion,2)








