def resourceNeedData(request):
  nivelCuenta = int(request.GET.get('nivelCuenta',1))
  bonusProduccion = int(request.GET.get('bonusProduccion',0))
  seleccionadosList = map(int, request.GET.get('recursosSeleccionados').split(','))
  nivelEdificioProduccion = int(request.GET.get('nivelEdificioProduccion',1))
  idRecursoSeleccionado = int(request.GET.get('id'))

  listaRecursosYcantidadesNecesarios=[]

  #calcular la produccion diaria del articulo final
  recursoFinal = buscar_recurso_por_id(idRecursoSeleccionado)
  produccionDiariaTotal = calcular_produccion_diaria_total(recursoFinal, bonusProduccion, nivelEdificioProduccion)

  #buscar cada recurso de la lista seleccionadosList en la clave producedFrom del diccionario recursoFinal (producedFrom es una lista de las materias necesarias para producir el articulo final)
  for j in seleccionadosList:
    for i in recursoFinal['producedFrom']:
      if i['resource']['db_letter']==j:
        dicRecursoNecesario = buscar_recurso_por_id(i['resource']['db_letter'])

        #calcular la cantidad diaria necesaria de los materiales necesarios
        necesario = i['amount']
        necesarioDia = produccionDiariaTotal*necesario

        a = calcular_materiales_necesarios(i['resource']['db_letter'],necesarioDia,bonusProduccion)
        nivelesYproduccionNecesarios = {'nombre':dicRecursoNecesario['name'], 'imagen':dicRecursoNecesario['image'], 'niveles':a[0], 'cantidadDia':a[1], 'necesarioDia':round(necesarioDia,2)}
        listaRecursosYcantidadesNecesarios.append(nivelesYproduccionNecesarios)

  Rfinal={'name':recursoFinal['name'],'dailyProduction':round(produccionDiariaTotal,2),'image':recursoFinal['image'],'producedFrom':recursoFinal['producedFrom']}
  return JsonResponse({'material':listaRecursosYcantidadesNecesarios,'recursoFinal':Rfinal})